sys_variable_value.value:
(function execute(inputs, outputs) {

    function validateAnnIncme(annIncme) {
        if (!annIncme) return;
        var incomeRegex = /^(?:[1-9]\d{0,12}|0)$/;
        if (!incomeRegex.test(annIncme)) {
            throw new Error("Invalid annIncme value. It should be in the range 0 - 10,00,00,00000.");
        }
        return true;
    }

    var annIncme = inputs.resp.data.proposerInfos.annIncme;
    validateAnnIncme(annIncme);

    function validateString(input, key) {
        if (!input) return;
        var pattern = /^(?=.{1,30}$).*$/;
        if (!pattern.test(input)) {
            throw new Error(`The ${key} must be between 1 and 30 characters long.`);
        }
    }

   validateString(inputs.resp.data.proposerInfos.frstNm, "fname");
validateString(inputs.resp.data.proposerInfos.lstNm, "Lname");
validateString(inputs.resp.data.lifeAssrdInfos.frstNm, "fname");
validateString(inputs.resp.data.lifeAssrdInfos.lstNm, "Lname");
if(inputs.resp.data.nomineeInfos[0]){
validateString(inputs.resp.data.nomineeInfos[0].frstNm, "fname");
validateString(inputs.resp.data.nomineeInfos[0].lstNm, "Lname");
if(inputs.resp.data.nomineeInfos[0].apnteDtls){
validateString(inputs.resp.data.nomineeInfos[0].apnteDtls.frstNm, "fname");
validateString(inputs.resp.data.nomineeInfos[0].apnteDtls.lstNm, "Lname");
}
}
validateString(inputs.resp.data.beneficiaryDtls.frstNm, "fname");
validateString(inputs.resp.data.beneficiaryDtls.lstNm, "Lname");
validateString(inputs.resp.data.trusteeDtls.name, "name");


    function validateDigits(inputStr) {
        if (!inputStr) return;
        var regex = /^\d{10,16}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Input must be a string of digits between 10 and 16 characters long.");
        }
        return true;
    }

    validateDigits(inputs.resp.data.proposerInfos.comunctnAddress.mobNo);

})(inputs, outputs);

