sys_variable_value.value:
(function execute(inputs, outputs) {

    var optionsArray = initializeOrUpdateOptionsArray();

    function initializeOrUpdateOptionsArray() {
        var gr = new GlideRecord('x_rptp_smartinte_0_integrationoptiondatatypemaster');
        gr.query();

        var tempArray = [];
        while (gr.next()) { 
            tempArray.push(gr.getValue('option').toLowerCase()); 
        }
        gs.info(JSON.stringify(tempArray)); 
        return tempArray;
    }

    function validation(value) {
        if (!value) return; 

        if (!optionsArray.includes(value.toLowerCase())) { 
            throw new Error('Value not found in the options array: ' + value);
        }
    }

  if (inputs.val && inputs.val.data && inputs.val.data.proposerInfos) {
    validation(inputs.val.data.proposerInfos.gender);
    validation(inputs.val.data.proposerInfos.mrtlSts);
    validation(inputs.val.data.proposerInfos.occ);
    validation(inputs.val.data.proposerInfos.myProf);
    validation(inputs.val.data.proposerInfos.orgType);
    validation(inputs.val.data.proposerInfos.indsType);
    validation(inputs.val.data.proposerInfos.nameOfOrg);
    validation(inputs.val.data.proposerInfos.relationWithLa);
    validation(inputs.val.data.proposerInfos.objective);

    if (inputs.val.data.proposerInfos.comunctnAddress) {
        validation(inputs.val.data.proposerInfos.comunctnAddress.nationality);
        validation(inputs.val.data.proposerInfos.comunctnAddress.state);
        validation(inputs.val.data.proposerInfos.comunctnAddress.country);
    }

    if (inputs.val.data.proposerInfos.prmntAddress) {
        validation(inputs.val.data.proposerInfos.prmntAddress.state);
        validation(inputs.val.data.proposerInfos.prmntAddress.country);
    }

    if (inputs.val.data.proposerInfos.kycDoc) {
        validation(inputs.val.data.proposerInfos.kycDoc.agePrf);
        validation(inputs.val.data.proposerInfos.kycDoc.addPrf);
        validation(inputs.val.data.proposerInfos.kycDoc.idPrf);
    }
}

if (inputs.val && inputs.val.data && inputs.val.data.lifeAssrdInfos) {
    validation(inputs.val.data.lifeAssrdInfos.gender);
    validation(inputs.val.data.lifeAssrdInfos.mrtlSts);
    validation(inputs.val.data.lifeAssrdInfos.education);
    validation(inputs.val.data.lifeAssrdInfos.occ);
    validation(inputs.val.data.lifeAssrdInfos.indtype);
    validation(inputs.val.data.lifeAssrdInfos.nationality);
    validation(inputs.val.data.lifeAssrdInfos.rstSts);
}

if (inputs.val && inputs.val.data && inputs.val.data.nomineeInfos) {
    validation(inputs.val.data.nomineeInfos.gender);
    validation(inputs.val.data.nomineeInfos.relationship);
}

if (inputs.val && inputs.val.data && inputs.val.data.beneficiaryDtls) {
    validation(inputs.val.data.beneficiaryDtls.relationWithLa);
}

if (inputs.val && inputs.val.data && inputs.val.data.trusteeDtls) {
    validation(inputs.val.data.trusteeDtls.relationWithLa);
    validation(inputs.val.data.trusteeDtls.state);
    validation(inputs.val.data.trusteeDtls.trusteeaccounttype);
}

if (inputs.val && inputs.val.data && inputs.val.data.insuranceInfos) {
    validation(inputs.val.data.insuranceInfos.cmpany);
}

if (inputs.val && inputs.val.data && inputs.val.data.ecsDetails) {
    validation(inputs.val.data.ecsDetails.payAccountType);
}

if (inputs.val && inputs.val.data && inputs.val.data.eiaDetails) {
    validation(inputs.val.data.eiaDetails.eiaInsuranceRepository);
}


})(inputs, outputs);

