        mandatorycheck(inputs.val.data.proposerInfos.orgType, 'others', inputs.val.data.proposerInfos.orgTypeDesc, 'orgTypeDesc');
    }

    if (inputs.val && inputs.val.data && inputs.val.data.lifeAssrdInfos) {
        mandatorycheck(inputs.val.data.lifeAssrdInfos.occ, 'others', inputs.val.data.lifeAssrdInfos.occDesc, 'occDesc');
    }

    function checkInsuranceInfo(insuranceInfos) {
        if (!insuranceInfos.sum) {
            throw new Error('Insurance sum is missing.');
        }
        if (!insuranceInfos.cmpany) {
            throw new Error('Insurance company is missing.');
        }
    }

    if (inputs.val && inputs.val.data && inputs.val.data.insuranceInfos && inputs.val.data.insuranceInfos[0]) {
        checkInsuranceInfo(inputs.val.data.insuranceInfos[0]);
    }

    function validateNomineeFields(age, field1, field2, field3, field4, field5) {
        if (age < 18) {
            if (!field1) throw new Error('Field1 is required for users under 18 years old.');
            if (!field2) throw new Error('Field2 is required for users under 18 years old.');
            if (!field3) throw new Error('Field3 is required for users under 18 years old.');
            if (!field4) throw new Error('Field4 is required for users under 18 years old.');
            if (!field5) throw new Error('Field5 is required for users under 18 years old.');
        }
    }

    function validateForm() {
        if (inputs.val && inputs.val.data && inputs.val.data.nomineeInfos && inputs.val.data.nomineeInfos[0]) {
            var nominee = inputs.val.data.nomineeInfos[0];
            var dateOfBirth = nominee.dob;
            var apnteDtls = nominee.apnteDtls || {};
            var field1 = apnteDtls.frstNm;
            var field2 = apnteDtls.lstNm;
            var field3 = apnteDtls.gender;
            var field4 = apnteDtls.dob;
            var field5 = apnteDtls.relationship;

            if (!dateOfBirth) {
                throw new Error('Date of birth is required.');
            }

            var [day, month, year] = dateOfBirth.split('-').map(Number);
            var birthDate = new Date(year, month - 1, day);
            var today = new Date();

            var age = today.getFullYear() - birthDate.getFullYear();
            var monthDiff = today.getMonth() - birthDate.getMonth();
            if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
                age--;
            }

            validateNomineeFields(age, field1, field2, field3, field4, field5);
        }
    }

    validateForm();

})(inputs, outputs);

