        safeValidateAndAssignDate(nomInfo[0].apnteDtls.dob, "appdob");
    }
}

if (benefeDtls) {
    safeValidateAndAssignDate(benefeDtls.dob, "benidob");
    safeValidateAndAssignString(benefeDtls.frstNm, 'fname');
    safeValidateAndAssignString(benefeDtls.lstNm, 'Lname');
}

if (trustDtls && trustDtls[0]) {
    safeValidateAndAssignDate(trustDtls[0].dob, "trusteedob");
    safeValidateAndAssignString(trustDtls[0].address, "address");
    safeValidateAndAssignString(trustDtls[0].trusteeNameofBankAccountHolder, 'trusteeNameofBankAccountHolder');
}

if (lifeAssrd) {
    safeValidateAndAssignDate(lifeAssrd.dob, "lifeAssrddob");
}


    function isValidDateFormat(dateStr) {
        const regex = /^\d{2}-\d{2}-\d{4}$/;
        return regex.test(dateStr);
    }

    function safeValidateAndAssignDate(dateStr, key) {
        if (!dateStr) return; 
        if (!isValidDateFormat(dateStr)) {
            throw new Error(`Invalid date format for ${key}: ${dateStr}. Expected format: dd-mm-yyyy.`);
        }
    }

    function isValidLength(str, min = 1, max = 30) {
        const length = str.length;
        return length >= min && length <= max;
    }

    function safeValidateAndAssignString(str, key) {
        if (!str) return; 
        if (!isValidLength(str)) {
            throw new Error(`Invalid length for ${key}: "${str}". Length should be between 2 and 30 characters.`);
        }
    }

    function validateMinMaxDigits(inputStr) {
        if (!inputStr) return; 
        var regex = /^\d{1,9}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Input must be a string of digits between 1 and 9 characters long.");
        }
    }

   
     validateMinMaxDigits(d.data.ecsDetails?.payMicrNo);

})(inputs, outputs);

